import styled from 'styled-components';

const Header = () => {


  return (
    <Wrapper>
      <p>SOS Alert</p>
      <h1>Coronavirus disease (COVID-19)</h1>
    </Wrapper>

  )


}


const Wrapper = styled.div`
background-color: red;
padding: 20px;
color: white;
font-family: 'helvetica';
  h1, p{
    margin: 0px
  }
`

export default Header
